import React from 'react';
import './style.css';

/**
* @author
* @function Navbar
**/

const Navbar = (props) => {
  return(
    <div  className="navbar">
      <ul className="navbarMenu">
        <li><a href="#">Home</a></li>
        <li><a href="#">About Us</a></li>
        <li><a href="#">Post</a></li>
        <li><a href="#">Contact Us</a></li>
      </ul>
       <div>
           <input/> 
           <img src={require("../../asserts/icons/Search.png")}alt="Search"/>
       </div>

    </div>
   )

 }

export default Navbar
